import React from "react";
import { Link } from "react-router-dom";

const Navbar = () => {
  return (
    
    <nav style={{ padding: "10px", background: "white", color: "#fff" }}>
      <Link to="/" style={{ margin: "20px", color: "black" }}>Login/signup</Link>
      <Link to="/home" style={{ margin: "0 20px", color: "black", textShadow }}>Home</Link>
      <Link to="/internships" style={{ margin: "0 10px", color: "#fff" }}>Internships</Link>
      <Link to="/apply" style={{ margin: "0 10px", color: "#fff" }}>Apply</Link>
      <Link to="/profile" style={{ margin: "0 10px", color: "#fff" }}>Profile</Link>
    </nav>
  
  );
};

export default Navbar;
